// XAxisWrapper.js
import React from 'react';
import { XAxis } from 'recharts';

const XAxisWrapper = ({ dataKey, label, ticks }) => {
  return (
    <XAxis
      dataKey={dataKey}
      label={label}
      ticks={ticks}
      height={60} // Visina ose, prilagoditi prema potrebi za prikaz etikete
      tick={{ fontSize: 14 }} // Stilizacija za oznake (ticks)
    />
  );
};

export default XAxisWrapper;
